import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { Routes, Route, Redirect, BrowserRouter } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>

    <Routes>
      <Route exact path="/" element={<App/>} />
      <Route path="homework-1.1" element={<App/>}/>
      <Route path="homework-1.2" element={<App/>}/>
      <Route path="homework-1.3" element={<App/>}/>
      <Route path="homework-1.4" element={<App/>}/>
      <Route path="homework-2.1" element={<App/>}/>
      <Route path="homework-2.2" element={<App/>}/>
      <Route path="homework-3.1" element={<App/>}/>
      <Route path="homework-3.2" element={<App/>}/>
      <Route path="homework-4" element={<App/>}/>
      <Route path="homework-6" element={<App/>}/>
      <Route path="homework-8" element={<App/>}/>
    </Routes>

  </>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
